class CustomerInformationDetailsSummaryComponent {
    constructor(dialogRef, router, localstore, apiService, loader) {
        this.dialogRef = dialogRef;
        this.router = router;
        this.localstore = localstore;
        this.apiService = apiService;
        this.loader = loader;
        this.title = "Customer Information Details";
        this.imgUrl = "assets/images/flagUSA.jpg";
    }
    ngOnInit() {
        this.productAccountIdCust = this.localstore.getItem('accountId');
        console.log("Account ID from Local Storage", this.productAccountIdCust);
        this.accountInfo = this.localstore.getItem('EDIT-CREATEACCCIF');
        console.log(this.accountInfo);
        if (this.accountInfo) {
            this.productAccountIdCust = this.accountInfo.businessProductAccount.accountId;
            this.productAccountType = this.accountInfo.businessProductAccount.accountType;
        }
        this.getCustomerInformationDetails();
    }
    getCustomerInformationDetails() {
        let accountType = 'savings';
        this.loader.open();
        if (!this.productAccountType) {
            this.productAccountType = accountType;
        }
        this.apiService.fetchAccountDependentInfo(this.productAccountIdCust, this.productAccountType)
            .subscribe((allCustomernResp) => {
            this.loader.close();
            this.customerSummary = allCustomernResp.data;
            this.customerId = allCustomernResp.data[0].customerId;
            this.Custownership = allCustomernResp.data[0].ownership;
            this.CustnumOfApplicants = allCustomernResp.data[0].numOfApplicants;
            this.customerDetails = allCustomernResp.data;
            for (let i = 0; i < this.customerDetails.length; i++) {
                let userAddress = this.customerDetails[i].userAddress;
                let pickOneAddress;
                let Address = "";
                if (userAddress.length > 1) {
                    pickOneAddress = userAddress.find((item) => item.addressType == "Permanent");
                }
                else {
                    pickOneAddress = userAddress[0];
                }
                Address = pickOneAddress.city + "," + pickOneAddress.state + "," + pickOneAddress.zipCode + "," + pickOneAddress.country;
                this.customerDetails[i].userAddress = Address;
            }
        }, (err) => {
            this.loader.close();
        });
    }
    goToClose() {
        this.dialogRef.close();
    }
    goToEdit() {
        this.dialogRef.close();
        this.router.navigate([`/home/application/customer-information/${this.productAccountIdCust}`]);
    }
}
