    constructor(api, router, ls, dialogRef, dialogService, data) {
        this.api = api;
        this.router = router;
        this.ls = ls;
        this.dialogRef = dialogRef;
        this.dialogService = dialogService;
        this.data = data;
        this.rekyc = false;
    }
